Derrick has come over to visit his father, but finds a rather frumpy looking girl fixing an expensive motorcycle. He thinks its one of the workers, but she claims to be dating his father. Derrick calls his father up and asks why he has started to date butch lesbians. His father says that there is more than meets the eye, but Derrick is skeptical. After taking care of his business at the house, Derrick comes back outside to check on what she is doing, and when she appears in the doorway looking like a million bucks, he is shocked! The ugly motorhead has become a beautiful socialite in the blink of an eye. Time to get to know dad's new girlfriend a little better.
